description:
Part of the Soloman Series: Great Pyramid Mystery Resolved (Volume Three)

The high overhead chambers of the Great Pyramid with low discharges as described in Volume One and Two of the series tells us a number of things to get ready for this breakthrough technology found in Volume Three. This is a schematic of the water lift system that perpetuated pumping/lift operations in the Great Pyramid. This drawing is a foundational key to the discovery of perpetual motion theory.
